import "./Login.css"
const Login = ()=>{

    return(
        <div className="box">
            <input className="input" placeholder="Login"></input>
            <input className="input" placeholder="Password"></input>
            <button className="button">Sign Up</button>
        </div>
    )
}

export default Login
